window.bookSummaryJSON = "<p>My life changed forever the day my father's oil rig crashed into the ocean. Now, three men want answers I don't have, and they'll do whatever it takes to get them.</p> <p>Jax, Morgan, and Blake want to destroy me, but I know their secret.</p> <p>I'm questioning everything I knew to be true. Especially when the truth about them leads to discovering a deep, long-hidden secret about myself.</p> <p>They aren't who they appear to be...but neither am I.</p> <p><b>Note: </b><b><i>Surge </i></b><b>is a paranormal enemies-to-lovers romance where the heroine does not have to choose. There are adult situations and light/medium bullying that happens in book one only. The series is complete.</b></p>"; 
